import img1 from '../img/img1.png';
import img2 from '../img/img2.png';
import img3 from '../img/img3.png';
import img4 from '../img/img4.jpg';

export const Followers = [
    { name: "Yosua Vega", username: "@yosuavega", img: img1 },
    { name: "Vega Chris", username: "@vegachris", img: img2 },
    { name: "Si Pantek", username: "@sipantek", img: img3 },
    { name: "Gatau Apa", username: "gatauApa", img: img4 }
];
